import React from "react";
import './Scale.css'

function Scale(props) {
    return(
        <div className="scaleBox">
            <div className="n1"></div>
            <div className="t"> 0-10 </div>
            <div className="n1"></div>
            <div className="t"> 11-100 </div>
            <div className="n1"></div>
            <div className="t"> 101-500 </div>
            <div className="n1"></div>
            <div className="t"> 501-1000 </div>
            <div className="n1"></div>
        </div>
    );
}

export default Scale;
